import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
        <header className="header">
            <a className="header__logo-link" href="#">
                <img className="header__logo" src="<%=require('./images/header__logo.svg')%>" alt="Логотип" />
            </a>
        </header>
    </div>
  );
}

export default App;
